  \"A sampling method for tundra swans in the Bristol Bay lowlands of the northern
  Alaska Peninsula: A summary of a presentation given at the Refuges and Wildlife
  Project Leaders' meeting, U.S. Fish and Wildlife Service, December 8-11, 1986\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:10.138175\",\n\t\"name\": \"a-sampling-method-for-tundra-swans-in-the-bristol-bay-lowlands-of-the-northern-alaska-p-11\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A \"census\" of tundra swans occurring
  in the northern Alaska Peninsula was collected over 1984-1985, with supplemental
  information provided from preliminary surveys conducted in 1983. Eighty-seven percent
  of the 18,023 km (6959 sq. mile) survey area was flown in June 1984 with the remaining
  13% surveyed in June 1985. The results enabled Alaska Peninsula/Becharof National
  Wildlife Refuges to develop a sampling method with predictable results. The 1:63360
  U.S. Geological Survey topographic quadrangle maps were used to survey swans, and
  were then subdivided into \"1/4 maps\" for subsequent sampling.\",\n\t\"license_title\":
